import base64
from io import BytesIO
import numpy as np
from PIL import Image
import keras_ocr

# Function to decode the base64 string into an image
def decode_base64(base64_string):
    # Remove the header (e.g., 'data:image/png;base64,') if it exists
    if base64_string.startswith('data:image'):
        base64_string = base64_string.split(',')[1]

    # Decode the base64 string
    img_data = base64.b64decode(base64_string)
    
    # Convert the binary data to an image
    img = Image.open(BytesIO(img_data))
    
    # If the image has an alpha channel (RGBA), convert it to RGB
    if img.mode == 'RGBA':
        img = img.convert('RGB')
    
    return img

# Function to detect text from base64 string using keras_ocr
def detect_text_from_base64(base64_string):
    # Decode the base64 string to image
    img = decode_base64(base64_string)

    # Convert the image to an array (numpy array)
    img_array = np.array(img)

    # Initialize the keras_ocr pipeline
    pipeline = keras_ocr.pipeline.Pipeline()

    # Detect text from the image
    prediction_groups = pipeline.recognize([img_array])

    # Debugging: Print the raw prediction output (both box and text)
    for group in prediction_groups[0]:
        print("Prediction:", group)  # Print the whole group, which contains (box, text)

    # Extract and return the detected text as strings
    detected_text = []
    for box, text in prediction_groups[0]:  # Unpack only box and text
        print("Raw Text:", text)  # Debugging: print raw text before conversion
        detected_text.append(str(text))  # Explicitly convert text to string

    return detected_text

# Example base64 string (replace with your actual base64 string)
base64_string = ""

# Get detected text from the base64 string
detected_text = detect_text_from_base64(base64_string)

# Print the detected text
print("Detected Text:", detected_text)




